        #region Public Methods

        public override void OnSearch()
        {
            if (tabControlSearch.SelectedTab == tpgSuchen)
            {
                foreach (Control ctl in UtilsGui.AllControls(tpgSuchen))
                {
                    if (ctl is KissButtonEdit)
                    {
                        KissButtonEdit edt = (KissButtonEdit)ctl;
                        edt.CheckPendingSearchValue();
                    }

                    if (ctl is CtlOrgUnitTeamUser)
                    {
                        ((CtlOrgUnitTeamUser)ctl).CheckPendingSearchValue();
                    }
                }
            }

            // Workaround um F3 weiter zu reichen, da das FrameWork das OrgUnitTeamUser UserControl nicht kennt
            try
            {
                if (((ContainerControl)ActiveControl).ActiveControl.Equals(ctlOrgUnitTeamUser))
                    edtName.Focus();
            }
            catch
            {
            }

            base.OnSearch();
        }

        #endregion

        #region Protected Methods

        protected override void NewSearch()
        {
            base.NewSearch();
            ctlOrgUnitTeamUser.NewSearch();

            edtNurAktive.Checked = true;
            edtNurPassive.Checked = false;

            edtSucheLeistungstraeger.Checked = true;

            edtMitSchuldner.Checked = false;

            edtName.Focus();
        }

        protected override void RunSearch()
        {
            if (DBUtil.IsEmpty(edtSucheFaProzessCodes.EditValue))
            {
                KissMsg.ShowInfo("Mindestens ein Leistungstyp muss ausgewählt sein.");
                throw new Exception();
            }

            if (DBUtil.IsEmpty(ctlOrgUnitTeamUser.SucheGruppe.EditValue) &&
                DBUtil.IsEmpty(ctlOrgUnitTeamUser.SucheTeam.EditValue) &&
                DBUtil.IsEmpty(ctlOrgUnitTeamUser.SucheUserID.EditValue) &&
                DBUtil.IsEmpty(edtSucheZIPNr.EditValue) &&
                DBUtil.IsEmpty(edtSucheBaPersonID.EditValue) &&
                DBUtil.IsEmpty(edtSucheFaFallID.EditValue))
            {
                KissMsg.ShowInfo("Mindestens eines der folgenden Felder muss ausgefüllt werden:\r\n\r\n" +
                    "- Organisationsgruppe\r\n" +
                    "- Team\r\n" +
                    "- Mitarbeitende\r\n" +
                    "- PID\r\n" +
                    "- Personen-Nr\r\n" +
                    "- Fall-Nr");
                throw new Exception();
            }

            base.RunSearch();
        }

        #endregion

        #region Private Methods

        private void edtInkasso_EditValueChanged(object sender, System.EventArgs e)
        {
            edtSucheFaProzessCodes.SetItemChecked(2, edtInkasso.Checked);
            edtSucheFaProzessCodes.SetItemChecked(3, edtInkasso.Checked);
            edtSucheFaProzessCodes.SetItemChecked(4, edtInkasso.Checked);
        }

        private void edtIntakeQT_EditValueChanged(object sender, System.EventArgs e)
        {
            edtSucheFaProzessCodes.SetItemChecked(0, edtIntakeQT.Checked);
            edtSucheFaProzessCodes.SetItemChecked(1, edtIntakeQT.Checked);
            edtSucheFaProzessCodes.SetItemChecked(5, edtIntakeQT.Checked);
            edtSucheFaProzessCodes.SetItemChecked(6, edtIntakeQT.Checked);
        }

        private void edtNurAktive_EditValueChanged(object sender, System.EventArgs e)
        {
            if (edtNurAktive.Checked)
            {
                edtNurPassive.Checked = false;
            }
        }

        private void edtNurPassive_EditValueChanged(object sender, System.EventArgs e)
        {
            if (edtNurPassive.Checked)
            {
                edtNurAktive.Checked = false;
            }
        }

        #endregion
